import SPM from '../index';

describe('SPM', () => {
  it('test typeof SPM', () => {
    expect(typeof SPM).toEqual('object');
  });

  it('SPM.getPageSPM', () => {
    expect(SPM.getPageSPM()).toEqual(['0', '0']);
  });

  it('SPM.setPageSPM', () => {
    SPM.setPageSPM('a1', 'b1');
    expect(SPM.getPageSPM()).toEqual(['a1', 'b1']);
  });
});
